import styled from "styled-components";

const CreateStyled = style.div`
    background-color:#144698;


`;

const Create = () => (
    <CreateStyled>
        <div class="columns is-mobile is-centered">
            <div class="column is-half">
                <h2 class="title is-2">
                    Enter the Future of Finance
                </h2>
                <h3 class="subtitle is-3">Empowering individual, investors, and developers to join the revolution</h3>
            </div>
        </div>

    </CreateStyled>
);

export default Create;
